import React, { Component } from 'react'

export default class Count extends Component {
  render() {
    return (
      <div>
        <h2>当前求和为：0</h2>
        <select ref={(c) => {this.selectedNumberElement = c}}>
          <option value="1">1</option>
          <option value="2">2</option>
          <option value="3">3</option>
        </select>
        <button>+</button>
        <button>-</button>
        <button>奇数+</button>
        <button>异步+</button>
      </div>
    )
  }
}
